<font NAME="SansSerif" SIZE="18"/>
<node COLOR="#00b439" CREATED="1177895672593" ID="Freemind_Link_1682691860" MODIFIED="1177916538968">
<richcontent TYPE="NODE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Platform &#8211; A machine/operating system combination or any network or storage device. Platforms are the lowest level of management, and include components such as CPU's, Network Interfaces, and File Systems.&#160;
    </p>
  </body>
</html>
</richcontent>
<font NAME="SansSerif" SIZE="16"/>
<icon BUILTIN="full-1"/>
</node>
<node COLOR="#00b439" CREATED="1177895685921" ID="Freemind_Link_1109290334" MODIFIED="1177916538968">
<richcontent TYPE="NODE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Server &#8211; Any software that is installed on a platform under management. Databases, middleware, virtualization, application and web servers are all examples of servers. Servers run on platforms. Platforms host multiple Servers. Examples of servers include any installations of JBoss, Tomcat, or MySQL on a given platform.&#160;
    </p>
  </body>
</html>
</richcontent>
<font NAME="SansSerif" SIZE="16"/>
<icon BUILTIN="full-2"/>
</node>
<node COLOR="#00b439" CREATED="1177895695406" ID="Freemind_Link_1851279036" MODIFIED="1177916538953">
<richcontent TYPE="NODE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Service &#8211; A component of a server dedicated to a specific purpose. Typically services are represented by the units of work of a given server. Different types of servers each define a list of one or more types of services they provide. Examples of services include Webapps deployed in Tomcat, or Virtual Hosts configured in Apache. Services can also be attached directly to a platform in the case of CPU, Network Interfaces and Filesystems.&#160;
    </p>
  </body>
</html>
</richcontent>
<font NAME="SansSerif" SIZE="16"/>
<icon BUILTIN="full-3"/>
</node>
<node COLOR="#00b439" CREATED="1177895718171" ID="Freemind_Link_1289592962" MODIFIED="1177916538937">
<richcontent TYPE="NODE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Application &#8211; A collection of platforms, servers and services organized to fulfill a single business purpose. Applications typically have many servers and services, and can also run on more then one platform. A typical J2EE application modeled in HQ can contain Apache Virtual Hosts, Tomcat Webapps, JBoss Connection pools, and Oracle Instances.&#160;
    </p>
  </body>
</html>
</richcontent>
<font NAME="SansSerif" SIZE="16"/>
<icon BUILTIN="full-4"/>
</node>
<node COLOR="#00b439" CREATED="1177895730859" ID="Freemind_Link_1873029652" MODIFIED="1177916538921">
<richcontent TYPE="NODE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Resource Type &#8211; A categorical description of a type of resource that can be managed. Upon installation, Hyperic HQ describes hundreds of resource types which include specifications for Name, Version, Available Metrics, and Available Control Actions. Resource types span Platforms, Servers, and Services.&#160;
    </p>
  </body>
</html>
</richcontent>
<font NAME="SansSerif" SIZE="16"/>
<icon BUILTIN="full-5"/>
</node>
<node COLOR="#00b439" CREATED="1177895752328" ID="Freemind_Link_1513772624" MODIFIED="1177916538906">
<richcontent TYPE="NODE"><html>
  <head>
    
  </head>
  <body>
    <p>
      Managed Resource &#8211; A specific instance of a resource type within the managed environment.&#160;
    </p>
  </body>
</html>
</richcontent>
